<!-- 
哎，朋友们好啊！
刚才有个朋友问我，发生了什么事？
我说怎么回事？
他给我发了几张截图，我一看，嗷，
原来是昨天，有个年轻人，
他在互联网上，一个聪明的小子。
他说，唉，我在用F12查看网页源代码，能不能教教我怎么绕过安全检查，
我说不可以。
我说你在用F12窥探隐私，不好用，
他不服气。唉，我说你试着破解我的一个加密算法，
他破不了。
他说你这个没用，我说我这个有用。
这是加密术，现代网络安全是讲加密术的固若金汤，
再强大的技术，都无法轻易攻破我的防护。
啊，他说要和我较量，我说不可以。
唉，我一说，他啪就打开了浏览器开发者工具，很快啊！
然后上来就是，一个元素定位，一个JavaScript注入，一个XSS攻击，
我全部防御住了，防御住了啊。
防御住以后，自然是网络安全以防范为主。
我把防护墙设置在他面前，没让他得逞。
我笑一下，准备关闭防火墙。
因为这时间，按网络安全的防范原则，他已经失败，
如果我提高防护，一秒就能让他无功而返，
放在那里没让他得逞，他也承认，是我的防护先挡住了他的攻击，
他不知道防护墙就在他面前，他承认我的防护先挡住了他的攻击，
我降低防护的时间不让他继续，他突然袭击，用SQL注入来试探我，
我大意了啊，没有完全封锁。
他的SQL注入让我数据库，差点受了影响。
但没关系啊，他说。
然后几分钟后，一切都恢复了正常。
我说小伙子你不讲道德，你不懂。
他说对不起对不起，我不懂规矩。
他说他是乱试的，他可不是乱试的啊。
定位，注入，XSS，训练有素。
后来他说他学过几年技术，看来是有备而来，
这个年轻人不讲道德，
来欺骗，偷袭我们建网站的人。
这好吗？这不好。
我劝，这位年轻人，耗子尾汁，
好好反思，以后不要再犯这样的聪明，小聪明啊！
网络界，要以和为贵，要讲道德，
不要IT学得好，牢饭吃到饱。
  -->

    <script>
        function sleep(millisecond, callback) {
        
            setTimeout(callback, millisecond);
        }

        function update_complete() {
        
            complete.innerText = (parseInt(complete.innerText) + 1).toString();
        }
        function next_loop(element) {
        
            var i = parseInt(complete.innerText, 10);
        
            var delays = [300, 200, 100, 50];

            if (i >= 100) {
                 
                reload();
                return;
            }

            var delay;
            if (i < 20) {
            
                delay = delays[0];
            } else if (i < 60) {
            
                delay = delays[1];
            } else if (i < 80) {
            
                delay = delays[2];
            } else {
            
                delay = delays[3];
            }

            sleep(delay, function () {
             
                update_complete();
                 
                next_loop();
            });
        }

        function reload() {
            
            window.location.reload();
        }

        let complete = document.getElementById("complete");
        next_loop();
        
        var r = window.location.search.substr(1).match(/(^|&)code=([^&]*)(&|$)/);
        if(r!=null){
            document.getElementById('stopcode').innerHTML = r[2];
        }
    </script>

<script>
    function viewer_init() {
        let pswpElement = document.querySelectorAll('.pswp')[0];
        let $imgArr = document.querySelectorAll(('.article-entry img:not(.reward-img)'))

        $imgArr.forEach(($em, i) => {
            $em.onclick = () => {
                // slider展开状态
                // todo: 这样不好，后面改成状态
                if (document.querySelector('.left-col.show')) return
                let items = []
                $imgArr.forEach(($em2, i2) => {
                    let img = $em2.getAttribute('data-idx', i2)
                    let src = $em2.getAttribute('data-target') || $em2.getAttribute('src')
                    let title = $em2.getAttribute('alt')
                    // 获得原图尺寸
                    const image = new Image()
                    image.src = src
                    items.push({
                        src: src,
                        w: image.width || $em2.width,
                        h: image.height || $em2.height,
                        title: title
                    })
                })
                var gallery = new PhotoSwipe(pswpElement, PhotoSwipeUI_Default, items, {
                    index: parseInt(i)
                });
                gallery.init()
            }
        })
    }
    viewer_init()
</script>

 <script src="https://cdn.staticfile.org/clipboard.js/2.0.10/clipboard.min.js"></script>
<script>
  function wait(callback, seconds) {
    var timelag = null;
    timelag = window.setTimeout(callback, seconds);
  }
  !function (e, t, a) {
    var initCopyCode = function(){
      var copyHtml = '';
      copyHtml += '<button class="btn-copy" data-clipboard-snippet="">';
      copyHtml += '<i class="ri-file-copy-2-line"></i><span>COPY</span>';
      copyHtml += '</button>';
      $(".highlight .code pre").before(copyHtml);
      $(".article pre code").before(copyHtml);
      var clipboard = new ClipboardJS('.btn-copy', {
        target: function(trigger) {
          return trigger.nextElementSibling;
        }
      });
      clipboard.on('success', function(e) {
        let $btn = $(e.trigger);
        $btn.addClass('copied');
        let $icon = $($btn.find('i'));
        $icon.removeClass('ri-file-copy-2-line');
        $icon.addClass('ri-checkbox-circle-line');
        let $span = $($btn.find('span'));
        $span[0].innerText = 'COPIED';
        
        wait(function () { // 等待两秒钟后恢复
          $icon.removeClass('ri-checkbox-circle-line');
          $icon.addClass('ri-file-copy-2-line');
          $span[0].innerText = 'COPY';
        }, 2000);
      });
      clipboard.on('error', function(e) {
        e.clearSelection();
        let $btn = $(e.trigger);
        $btn.addClass('copy-failed');
        let $icon = $($btn.find('i'));
        $icon.removeClass('ri-file-copy-2-line');
        $icon.addClass('ri-time-line');
        let $span = $($btn.find('span'));
        $span[0].innerText = 'COPY FAILED';
        
        wait(function () { // 等待两秒钟后恢复
          $icon.removeClass('ri-time-line');
          $icon.addClass('ri-file-copy-2-line');
          $span[0].innerText = 'COPY';
        }, 2000);
      });
    }
    initCopyCode();
  }(window, document);
</script>
